func TestWriteZip(t *testing.T) {
	fmt.Println("creating zip archive...")

	bbuf := bytes.Buffer{}
	zipWriter := zip.NewWriter(&bbuf)

	fmt.Println("opening first file...")
	f1, err := os.Open("/Users/william/Downloads/report_2023/2f0f4318de11a2c65edc92f00cc6e54bbda41ac1.json")
	if err != nil {
		panic(err)
	}
	defer f1.Close()

	fmt.Println("writing first file to archive...")
	w1, err := zipWriter.Create("2f0f4318de11a2c65edc92f00cc6e54bbda41ac1.json")
	if err != nil {
		panic(err)
	}
	if _, err := io.Copy(w1, f1); err != nil {
		panic(err)
	}

	fmt.Println("opening second file")
	f2, err := os.Open("/Users/william/Downloads/report_2023/report.json")
	if err != nil {
		panic(err)
	}
	defer f2.Close()

	fmt.Println("writing second file to archive...")
	w2, err := zipWriter.Create("report.json")
	if err != nil {
		panic(err)
	}
	if _, err := io.Copy(w2, f2); err != nil {
		panic(err)
	}
	fmt.Println("closing zip archive...")
	zipWriter.Close()

	s := base64.StdEncoding.EncodeToString(bbuf.Bytes())
	fmt.Println(s)
	t.Error()
}

